import React, { useState, useContext, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { ExpenseContext } from '../context/ExpenseContext';
import './IncomeForm.css';

const IncomeForm = () => {
  const [formData, setFormData] = useState({
    source: '',
    amount: '',
    date: new Date().toISOString().slice(0, 10),
    description: ''
  });
  
  const [error, setError] = useState('');
  const { addIncome, incomeCategories } = useContext(ExpenseContext);
  const navigate = useNavigate();
  
  // Make sure we have valid category options
  const safeCategories = Array.isArray(incomeCategories) ? incomeCategories : [];
  
  // Reset form error when user makes changes
  useEffect(() => {
    if (error) setError('');
  }, [formData]);
  
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };
  
  const handleSubmit = (e) => {
    e.preventDefault();
    setError('');
    
    // Validate form
    if (!formData.source) {
      setError('Please select a source');
      return;
    }
    
    if (!formData.amount || isNaN(parseFloat(formData.amount)) || parseFloat(formData.amount) <= 0) {
      setError('Please enter a valid amount greater than zero');
      return;
    }
    
    if (!formData.date) {
      setError('Please select a date');
      return;
    }
    
    // Try to add the income
    const success = addIncome(formData);
    
    if (success !== false) {
      navigate('/history');
    } else {
      setError('Failed to add income. Please try again.');
    }
  };
  
  return (
    <div className="income-form-container">
      <h1>Add New Income</h1>
      
      {error && (
        <div style={{ 
          padding: '10px', 
          marginBottom: '20px', 
          backgroundColor: '#ffe8e8', 
          color: '#d32f2f',
          borderRadius: '4px' 
        }}>
          {error}
        </div>
      )}
      
      <form className="income-form" onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="source">Source*</label>
          <select
            id="source"
            name="source"
            value={formData.source}
            onChange={handleChange}
            required
          >
            <option value="">Select a source</option>
            {safeCategories.map((source) => (
              <option key={source} value={source}>{source}</option>
            ))}
          </select>
        </div>
        
        <div className="form-group">
          <label htmlFor="amount">Amount*</label>
          <input
            type="number"
            id="amount"
            name="amount"
            value={formData.amount}
            onChange={handleChange}
            min="0.01"
            step="0.01"
            placeholder="0.00"
            required
          />
        </div>
        
        <div className="form-group">
          <label htmlFor="date">Date*</label>
          <input
            type="date"
            id="date"
            name="date"
            value={formData.date}
            onChange={handleChange}
            required
          />
        </div>
        
        <div className="form-group">
          <label htmlFor="description">Description</label>
          <input
            type="text"
            id="description"
            name="description"
            value={formData.description}
            onChange={handleChange}
            placeholder="Optional description"
          />
        </div>
        
        <div className="form-actions">
          <button type="button" className="cancel-btn" onClick={() => navigate('/history')}>
            Cancel
          </button>
          <button type="submit" className="submit-btn">
            Add Income
          </button>
        </div>
      </form>
    </div>
  );
};

export default IncomeForm;
